import OptionsHeader from './components/OptionsHeader';



const iconOption = [perfil, sacola];


function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <Logo />
        <OptionsHeader />


      </header>
    </div>
  );
};

export default App;
